        <SearchHeader 
        onSearch = {setSearch}
        name={items.name}/>
      <div className="block-cards">
          {
            items.filter(category=>category.products.find(product=>
              {debugger 
              return product.name.includes(search)}
              )).map((obj) => 
            <div>
              <ProductsBlock_v2 
              search = {search}
              title={obj.category}
              data={obj.products}/>
            </div>)
          }
      </div>
    </div>
  )
}

